Fixes #927. We also extract some common logic in
`AccessPathNullnessPropagation` around handling equality comparisons to
avoid duplication.', 'committedDate': '2024-03-19T17:14:12Z', 'author': {'name': 'Manu Sridharan', 'email': 'msridhar@gmail.com', 'date': '2024-03-19T10:14:12-07:00'}}}, {'node': {'message': 'JSpecify: Handle @Nullable assignments to @Nonnull arrays (#929)

Handles cases in JSpecify mode where a `@Nullable` element is assigned
to an unannotated array. Added relevant unit tests.

**Current Behavior**

Both are valid assignments.

```
String [] foo = new String[10];
@Nullable String [] bar = new String [10];
foo[1] = null;
bar[1] = null;
```

**New Behavior**

Assignment to `foo` generates an error since array elements are
`@Nonnull`.

```
String [] foo = new String[10];
@Nullable String [] bar = new String [10];
foo[1] = null;
bar[1]=null;
```

---------

